import React, { Component } from 'react'
import "./sidebar.css"
import SideBarRow from "./sidebarRow/SideBarRow"
import HomeIcon from "@material-ui/icons/Home";
import LibraryMusicIcon from '@material-ui/icons/LibraryMusic';import WhatshotIcon from "@material-ui/icons/Whatshot";
import SportsEsportsIcon from '@material-ui/icons/SportsEsports';
import VideoLibraryIcon from '@material-ui/icons/VideoLibrary';
import DriveEtaIcon from '@material-ui/icons/DriveEta';
import OndemandVideoIcon from '@material-ui/icons/OndemandVideo';
import WatchLaterIcon from '@material-ui/icons/WatchLater';
import ThumbUpIcon from '@material-ui/icons/ThumbUp';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';


export default class Sidebar extends Component {
    render() {
        return (
            <div className="sidebar">
                <SideBarRow Icon={HomeIcon} title="Home"/>
                <SideBarRow Icon={LibraryMusicIcon} title="Music"/>
                <SideBarRow Icon={SportsEsportsIcon} title="Gaming"/>
                <hr />
                <SideBarRow Icon={VideoLibraryIcon} title="Library"/>
                <SideBarRow Icon={DriveEtaIcon} title="Auto"/>
                <SideBarRow Icon={OndemandVideoIcon} title="Your Videos"/>
                <SideBarRow Icon={WatchLaterIcon} title="Watch Later"/>
                <SideBarRow Icon={ThumbUpIcon} title="Liked Videos"/>
                <SideBarRow Icon={ExpandMoreIcon} title="Show more"/>
            </div>
        )
    }
}
